INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<h2 class="alt">\r\n	Welcome to Seven, a beautifull Drupal 7 Responsive HTML5 &amp; CSS3 Theme for your Business, Agency, Freelance, Corporate or digital Portfolio. It&#39;s 99% ready. The only thing left here, is your own content.</h2>\r\n', 'Seven - Welcome Block', 'full_html'),
(5, 'Ut consectetur ullamcorper purus a rutrum. aenean dictum vulputate porta. nunc sed mi arcu. in semper consectetur quam nec tristique. in consequat massa eget dui ultrices sit amet auctor libero molestie. nullam rutrum convallis lacus non mattis. nam enim libero, lacinia a tristique a, accumsan sed purus. curabitur lorem orci.', 'Product Portfolio Intro', 'filtered_html'),
(7, '<p>Copyright 2014. Seven is a Premium Theme for <a href="http://drupal.org">Drupal</a> 7.x created by <a href="http://doublemthemes.com">DoubleMThemes</a> <a class="link-top right" href="#">Back to Top</a></p>\r\n<p><a class="link-top top-link-block" href="#">Back to Top</a></p>\r\n', 'Copyright Block', 'full_html'),
(8, 'If you''re interested, you can mail us at support [at] doublemthemes.com\r\n\r\nWe''re on #99999 Lorem Ipsum Street\r\nQuisque  PC 45300\r\nMontreal, Canada\r\n\r\nYou can also use the following <strong>Contact Form</strong>.', 'Seven - Contact Info Block', 'filtered_html');
