('node', 'page', 0, 29, 29, 'und', 0, '<p>Following are the <strong>most important features included on Seven</strong>, an awesome Drupal 7 Premium Theme for building business, corporate, agency and freelance websites 99% ready. The only thing you''ll need to do to is to replace all content with your own.</p>\r\n\r\n<h3>Seven is a 99% ready site as soon as you install it</h3>\r\n\r\n<p>What does this mean? Very simple, <strong>it comes with sample content so you don''t have to build things from scratch</strong>. It means that where you see an image, you only replace it with yours, where you see a text, you replace it with yours, an icon, an slide, an info... it means you won''t spent weeks making a site. You''ll only need to replace stuff and got your site workind. Of course. If you also know a little bit of Drupal, you can integrate it with more than 12.000 modules across the web and extend your site to much more advanced features.</p>\r\n\r\n<img src="sites/default/files/theme-features.jpg" style="border: none;" />\r\n\r\n<h3>7 different Home Pages</h3>\r\n\r\n<p>Seven includes <strong>7 Home Pages</strong> you can select for your site welcome page. Each one includes a beautiful jQuery Slideshow with over +25 possible effects you can choose to transition your slides. All of them are fully responsive and can be easily configured as the Home Page of yourr website. You can read more details <a href="7-different-home-pages">here.</p>\r\n\r\n<img src="sites/default/files/theme-features-home-pages.jpg" style="border: none;" />\r\n\r\n<p>Also you can place featured content right at the secondary area of your Home Page, show your recent products/portfolio and you can even place your clients Logos, sponsors and technoligies you use. Seven provides a wide set of options to ensure your site resume at the Home of your site.</p>\r\n\r\n<h3>Fully Responsive Layout</h3>\r\n\r\n<p>Seven is a theme that <strong>addapts to visitor''s devices</strong>, no matter if they''re using an iPhone in Portrait or Landscape mode, if they''re using an iPad or just on a common desktop computer. They will allways see your site with a special version enhacing the user experience while browsing your content.</p>\r\n\r\n<h3>Search Engines Optimized</h3>\r\n\r\n<p>Seven <strong>contains a lot of SEO best practices</strong>. It uses semantically valid HTML code and CSS on every View & Content Page so search engines can index them easily. Headlines are where they should be (h1, h2, h3, h4 etc) depending on the View hierarchy. It helps Search Engines like Google & Yahoo, to “understand” the ranking of your content inside your pages, even when the boots that rank pages, are just computers. Resuming, Seven provides an internal SEO feature that will allow you to place your content online and get it on high ranking probabilities.</p>\r\n\r\n<h3>Advanced Typography Features</h3>\r\n\r\n<p>As you can see on the <a href="typography-features" target="_blank" >Typography Features sample page</a>, Seven includes a lot of predefined styles to enhace readability and distribution of your textual content. It also includes a backend WYSIWYG rich textual content editor for creating your Pages, Articles and even Product descriptions. You can also preview a <a href="blog/2012/05/16/ac-lectus-enim-gravida-ultricies-magna" target="_blank" >sample article with comments</a> to know how will they be seen once your visitors start sharing comments on your posts.</p>\r\n\r\n<h3>Right Sidebar and Left Sidebar support</h3>\r\n\r\n<p>Seven also includes the option to place your complementary content and the one from the thousands of blocks you can find at Drupal.org in one of the sidebars you choose. This sample page is using a Right Sidebar content, but you can see the Left Sidebar sample in the <a href="blog">Blog page</a>.</p>\r\n\r\n<h3>404 Error Page</h3>\r\n\r\n<p>For usability purposes, <a href="oooops-you-might-be-lost">a 404 Error page</a> is also included to allow lost visitors to get back on the track and keep visiting your site, instead of having the disapoint of getting to a dead end on your site.</p>\r\n\r\n<h3>Detailed Theme Documentation</h3>\r\n\r\n<p>As you can preview here, Seven includes a detailed documentation (also included on the package you buy) that allows you to learn from how to install it on your web server to know the CSS and HTML details you need to know for advanced theme editing.</p>\r\n\r\n<h3>Rock Solid Support</h3>\r\n\r\n<p>If you get stucked with Seven, we grant you a solid support service to help you get rid of your issues and get the most of Seven. As we''re located on GMT-5 we ask patience to our clients as we allways answer our request tickets in less than 24 hours from Monday to Friday.</p>', '', 'full_html'),
('node', 'page', 0, 30, 30, 'und', 0, '<p>Seven includes <strong>7 Home Pages</strong> you can select for your site welcome page. Each one includes a beautiful jQuery Slideshow with over +25 possible effects you can choose to transition your slides. All of them are fully responsive and can be easily configured as the Home Page of yourr website.</p>\r\n\r\n<img src="sites/default/files/theme-features-home-pages.jpg" style="border: none;" />\r\n\r\n<p>Also you can place featured content right at the secondary area of your Home Page, show your recent products/portfolio and you can even place your clients Logos, sponsors and technoligies you use. Seven provides a wide set of options to ensure your site resume at the Home of your site.</p>\r\n\r\n<h3>The Home Pages</h3>\r\n\r\n<p>Following, is the list of the Home Pages variants included on Seven with a small info and a preview. You can also test each one of them by clicking on the images or just browsing via the top navigation menu:</p>\r\n\r\n<h4>Variant 1 - Overlay Text</h4>\r\n<p>Transparent Overlay with wide images. <a href="home-variant-1" target="_blank">Give it a look</a>.</p>\r\n<a href="home-variant-1" target="_blank"><img src="sites/default/files/theme-features-home-page-1.jpg" /></a>\r\n\r\n<h4>Variant 2 - Transparent PNG</h4>\r\n<p>Wide gradient background for transparent PNG showcase. <a href="home-variant-2" target="_blank">Give it a look</a>.</p>\r\n<a href="home-variant-2" target="_blank"><img src="sites/default/files/theme-features-home-page-2.jpg" /></a>\r\n\r\n<h4>Variant 3 - Clean & Minimalist</h4>\r\n<p>Clean background, special for presentation impact. A little but Apple influenced :)  <a href="home-variant-3" target="_blank">Give it a look</a>.</p>\r\n<a href="home-variant-3" target="_blank"><img src="sites/default/files/theme-features-home-page-3.jpg" /></a>\r\n\r\n<h4>Variant 4 - Overlay + Thumbnails</h4>\r\n<p>Wide textured background for thumbnail Slideshows. <a href="home-variant-4" target="_blank">Give it a look</a>.</p>\r\n<a href="home-variant-4" target="_blank"><img src="sites/default/files/theme-features-home-page-4.jpg" /></a>\r\n\r\n<h4>Variant 5 - Page Cut</h4>\r\n<p>Clean page effect over a wide background. <a href="home-variant-5" target="_blank">Give it a look</a>.</p>\r\n<a href="home-variant-5" target="_blank"><img src="sites/default/files/theme-features-home-page-5.jpg" /></a>\r\n\r\n<h4>Variant 6 - Wide Orange (default)</h4>\r\n<p>The default Home Page included on Seven Premium Theme. <a href="home-variant-6" target="_blank">Give it a look</a>.</p>\r\n<a href="home-variant-6" target="_blank"><img src="sites/default/files/theme-features-home-page-6.jpg" /></a>\r\n\r\n<h4>Variant 7 - Wide Blue</h4>\r\n<p>Wide variant over a Blue textured background. <a href="home-variant-7" target="_blank">Give it a look</a>.</p>\r\n<a href="home-variant-7" target="_blank"><img src="sites/default/files/theme-features-home-page-7.jpg" /></a>', '', 'full_html'),
('node', 'page', 0, 31, 31, 'und', 0, '<p>Seven includes <strong>4 products portfolios</strong> for showcasing your own work. You can link them from the Home Page Sliders and visitors can even share them using their favorite social network resource.</p>\r\n\r\n<img src="sites/default/files/theme-features-portfolio.jpg" style="border: none;" />\r\n\r\n\r\n<ul>\r\n<li>3 Columns Portfolio - <a href="portfolio-3-columns" target="_blank">Give it a look</a></li>\r\n<li>2 Columns Portfolio - <a href="portfolio-2-columns" target="_blank">Give it a look</a></li>\r\n<li>1 Column Portfolio - <a href="portfolio-1-column" target="_blank">Give it a look</a></li>\r\n<li>ColorBox Portfolio - <a href="portfolio-colorbox" target="_blank">Give it a look</a></li>\r\n</ul>\r\n\r\n<h3>We call it Product, but you can make it whatever you need</h3>\r\n\r\n<p>Products is the most generic call to a Portfolio item, bout you can use it as:</p>\r\n\r\n<ul>\r\n<li>Project</li>\r\n<li>Artwork</li>\r\n<li>Painting</li>\r\n<li>Photography</li>\r\n<li>Icon Design</li>\r\n<li>Print Design</li>\r\n<li>What ever you want... :)</li>\r\n</ul>\r\n\r\n<p>You can also add 5 Images to each Product + the main Image to allow visitors to see it more detailed. Every image in a Product can be visualized at fullscreen mode using ColorBox. If you want to give it a look, just test this <a href="products/curabitur-ipsum-arcu-molestie-adipiscing-consequat-cursus-leo">sample product page</a>.</p>\r\n', '', 'full_html'),
