('node', 'page', 0, 37, 37, 'und', 0, '<p>Seven seems awesome on tablet/mobile devices! It allows you to showcase your site everywhere and allow everybody to get the most of your content. Responsive layouts are a MUST nowadays, as each time more people use their smartphones and tablets over browsing on a desktop computer.</p>\r\n<p>Seven has a&nbsp;4 Level <strong>Fully Responsive Layout</strong> based on <strong>HTML5 and CSS3</strong></p>\r\n<ul>\r\n	<li>\r\n		<strong>iPhone/Android mobile devices in Landscape position</strong></li>\r\n	<li>\r\n		<strong>iPhone/Android mobile devices in Portrait position</strong></li>\r\n	<li>\r\n		<strong>iPad/Tablet PC devices in Portrait</strong> and <strong>Landscape</strong> mode layout</li>\r\n	<li>\r\n		<strong>Normal Desktop and Wide Screen</strong>&nbsp;for Netbooks, Mac or PC layout.</li>\r\n</ul>\r\n<p><img alt="" src="/723/seven_1_22/sites/default/files/features/retina.png" style="max-width: 620px; height: auto;" /></p>\r\n', '', 'full_html'),
('node', 'page', 0, 38, 38, 'und', 0, '<p>We aim doubts, requests and issues using a 3 way plan which includes Video Tutorials for general needs, Documentation for detailed precedures and forums for anything that can&#39;t be solved with Docs and Videos. Feel free to contact us once you buy Seven in case you need it, it is included in your price and we will support you.</p>\r\n<h2>\r\n	VideoTutorials + Documentation + Support</h2>\r\n<p><img alt="" src="/723/seven_1_22/sites/default/files/features/support.jpg" style="max-width: 620px; height: auto;" /></p>\r\n<h2>\r\n	Seven Video Tutorials</h2>\r\n<p>Seven has a wide set of HD Video Tutorials that allows you to know how to proceed in certain circunstances while you interact with the theme and the backend itself.</p>\r\n<p>The complete list of videos for Seven can be found here:&nbsp;http://www.youtube.com/watch?v=R62ZjkmPnz4&amp;list=PLtB1ktcnJ7IVUtFtzXb1rdrLNhFap1OcP</p>\r\n<h2>\r\n	Seven Documentation</h2>\r\n<p>To read all Seven Documentation (it is also included on the package once you buy Seven), but can also previewed here http://demos.doublemthemes.com/seven/documentation/</p>\r\n', '', 'full_html'),
