(29, 'node', ' theme features following are the most important features included on seven  an awesome drupal 7 premium theme for building business corporate agency and freelance websites 99 ready the only thing you ll need to do to is to replace all content with your own seven is a 99 ready site as soon as you install it what does this mean very simple  it comes with sample content so you don t have to build things from scratch  it means that where you see an image you only replace it with yours where you see a text you replace it with yours an icon an slide an info it means you won t spent weeks making a site you ll only need to replace stuff and got your site workind of course if you also know a little bit of drupal you can integrate it with more than 12000 modules across the web and extend your site to much more advanced features 7 different home pages seven includes 7 home pages you can select for your site welcome page each one includes a beautiful jquery slideshow with over 25 possible effects you can choose to transition your slides all of them are fully responsive and can be easily configured as the home page of yourr website you can read more details here also you can place featured content right at the secondary area of your home page show your recent products portfolio and you can even place your clients logos sponsors and technoligies you use seven provides a wide set of options to ensure your site resume at the home of your site fully responsive layout seven is a theme that addapts to visitor s devices  no matter if they re using an iphone in portrait or landscape mode if they re using an ipad or just on a common desktop computer they will allways see your site with a special version enhacing the user experience while browsing your content search engines optimized seven contains a lot of seo best practices  it uses semantically valid html code and css on every view content page so search engines can index them easily headlines are where they should be h1 h2 h3 h4 etc depending on the view hierarchy it helps search engines like google yahoo to understand the ranking of your content inside your pages even when the boots that rank pages are just computers resuming seven provides an internal seo feature that will allow you to place your content online and get it on high ranking probabilities advanced typography features as you can see on the typography features sample page  seven includes a lot of predefined styles to enhace readability and distribution of your textual content it also includes a backend wysiwyg rich textual content editor for creating your pages articles and even product descriptions you can also preview a sample article with comments to know how will they be seen once your visitors start sharing comments on your posts right sidebar and left sidebar support seven also includes the option to place your complementary content and the one from the thousands of blocks you can find at drupalorg in one of the sidebars you choose this sample page is using a right sidebar content but you can see the left sidebar sample in the blog page  404 error page for usability purposes  a 404 error page is also included to allow lost visitors to get back on the track and keep visiting your site instead of having the disapoint of getting to a dead end on your site detailed theme documentation as you can preview here seven includes a detailed documentation also included on the package you buy that allows you to learn from how to install it on your web server to know the css and html details you need to know for advanced theme editing rock solid support if you get stucked with seven we grant you a solid support service to help you get rid of your issues and get the most of seven as we re located on gmt5 we ask patience to our clients as we allways answer our request tickets in less than 24 hours from monday to friday  ', 0),
(30, 'node', ' 7 different home pages seven includes 7 home pages you can select for your site welcome page each one includes a beautiful jquery slideshow with over 25 possible effects you can choose to transition your slides all of them are fully responsive and can be easily configured as the home page of yourr website also you can place featured content right at the secondary area of your home page show your recent products portfolio and you can even place your clients logos sponsors and technoligies you use seven provides a wide set of options to ensure your site resume at the home of your site the home pages following is the list of the home pages variants included on seven with a small info and a preview you can also test each one of them by clicking on the images or just browsing via the top navigation menu  variant 1 overlay text transparent overlay with wide images give it a look  variant 2 transparent png wide gradient background for transparent png showcase give it a look  variant 3 clean minimalist clean background special for presentation impact a little but apple influenced  give it a look  variant 4 overlay thumbnails wide textured background for thumbnail slideshows give it a look  variant 5 page cut clean page effect over a wide background give it a look  variant 6 wide orange default  the default home page included on seven premium theme give it a look  variant 7 wide blue wide variant over a blue textured background give it a look  ', 0);
